import React from "react";

const Sidebar = () => {
  return (
    <aside className="w-64 bg-black text-white flex flex-col">
      <div className="p-6 text-2xl font-bold border-b border-blue-700">
        Assignment Manager
      </div>
      <nav className="flex-1 p-4">
        <ul className="space-y-4">
          <li><a href="#" className="hover:text-primary">Dashboard</a></li>
          <li><a href="#" className="hover:text-primary">Courses</a></li>
          <li><a href="#" className="hover:text-primary">Calendar</a></li>
          <li><a href="#" className="hover:text-primary">Groups</a></li>
          <li><a href="#" className="hover:text-primary">Notifications</a></li>
          <li><a href="#" className="hover:text-primary">Settings</a></li>
        </ul>
      </nav>
    </aside>
  );
};

export default Sidebar;
